import React from 'react';
import Thumb from './Thumb';

const Product = ({ product }) => {
  return (
    <div>
      <Thumb
        classes="shelf-item__thumb"
        src={require(`../static/products/${product.sku}_1.jpg`)}
        alt={product.title}
      />
    </div>
  )
}

export default Product;
